  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Bowdoin NWR outlines
  Refuge accomplishments from May through August of 1944. The report begins by summarizing
  the weather conditions, water conditions, and food and cover during this period.
  Wildlife- including migratory birds, upland game birds, big game animals, raptors,
  fish, and disease- is also covered. The Refuge development and maintenance section
  discusses physical developments and plantings. Resource management is outlined;
  topics include grazing. The public relations section of the report describes Refuge
  visitors. N-R forms, an update on the easement refuges, and photographs are attached.\",\n\t\"owner_org\":
